import React from 'react'

function doneImg(props) {
    if (props.done) {
        return (<img src="./images/lixeira.jpg" alt='delete'></img>)
    }
}


function List(props) {

    return (<ul  >
        {props.items.map(item => <li key={item.id}>
            {item.text}
            <button onClick={() => { }}></button>
            <button onClick={() => { props.onItemDeleted(item) }}><img src="./images/lixeira.jpg" alt='delete'></img></button>
        </li>)}
    </ul>)
}

export default List;
